import React from 'react';
import { Image } from 'lucide-react';

const VisualizationPanel = () => {
  return (
    <div className="bg-black/30 backdrop-blur-sm rounded-2xl p-4 border border-white/10">
      <h2 className="text-lg font-semibold text-white mb-4">Component Visualization</h2>
      <div className="aspect-square bg-gradient-to-br from-purple-500/20 to-indigo-600/20 rounded-xl flex items-center justify-center">
        <Image className="w-12 h-12 text-indigo-300" />
      </div>
    </div>
  );
};

export default VisualizationPanel;
